import{_ as e,c as r,o as l,a as t}from"./app.9dbb06c5.js";const _='{"title":"Object V8 \u5BF9\u8C61\u6A21\u578B","description":"","frontmatter":{},"headers":[],"relativePath":"FE-Language/ES/type-6-object.md"}',a={},o=t('<h1 id="object-v8-\u5BF9\u8C61\u6A21\u578B" tabindex="-1">Object V8 \u5BF9\u8C61\u6A21\u578B <a class="header-anchor" href="#object-v8-\u5BF9\u8C61\u6A21\u578B" aria-hidden="true">#</a></h1><blockquote><p>\u5728 V8 \u91CC\uFF0C\u4E00\u5207\u770B\u4F3C\u532A\u5937\u6240\u601D\u7684\u8BBE\u8BA1\uFF0C\u6700\u6839\u672C\u7684\u539F\u56E0\u5C31\u662F\u4E3A\u4E86\u66F4\u5FEB\u3002\u2014\u2014 \u5F15\u81EA\u7F51\u7EDC</p></blockquote><p>\u95EE\u9898\uFF1A</p><ol><li>JavaScript V8 \u5F15\u64CE\u662F\u5982\u4F55\u5B9E\u73B0 JavaScript \u5BF9\u8C61\u6A21\u578B\u7684</li><li>\u4F7F\u7528\u4E86\u54EA\u4E9B\u6280\u5DE7\u6765\u52A0\u5FEB\u83B7\u53D6\u5BF9\u8C61\u5C5E\u6027</li><li>delete \u64CD\u4F5C\u5BF9\u5BF9\u8C61\u5185\u5B58\u7ED3\u6784\u7684\u5F71\u54CD</li><li>\u51FD\u6570\u3001\u6570\u7EC4\u3001\u96C6\u5408\uFF08set/map)\u5982\u4F55\u5728\u5BF9\u8C61\u57FA\u7840\u4E0A\u5B9E\u73B0\u7684</li></ol><p>\u5728 V8 \u4E2D\uFF0C\u5BF9\u8C61\u6A21\u578B\u4E3B\u8981\u7531\u4E09\u4E2A\u6307\u9488\u6784\u6210\uFF0C\u5206\u522B\u662F\u9690\u85CF\u7C7B\uFF08Hidden Class\uFF09\uFF0CProperty \u8FD8\u6709 Element\u3002</p><ul><li>\u9690\u85CF\u7C7B\uFF08Hidden Class\uFF09: \u63CF\u8FF0\u5BF9\u8C61\u7ED3\u6784</li><li>\u5E8F\u5217\u5C5E\u6027 elements <ul><li>FastElements</li><li>SlowElements</li></ul></li><li>\u547D\u540D\u5C5E\u6027 properties <ul><li>\u5BF9\u8C61\u5185\u5C5E\u6027\uFF08in-object properties\uFF09</li><li>\u5FEB\u5C5E\u6027\uFF08fast properties\uFF09</li><li>\u6162\u5C5E\u6027\uFF08slow properties\uFF09</li></ul></li></ul><p>\u9996\u5148\uFF0CECMAScript \u89C4\u8303\u5BF9\u5BF9\u8C61\u7684\u63CF\u8FF0\u6709\u4E24\u70B9\uFF1A</p><ol><li>\u5B9A\u4E49\u4E3A\u7531\u5B57\u7B26\u4E32\u952Ekey\u6620\u5C04\u5230 property\u5C5E\u6027\u7684\u5B57\u5178\u3002</li><li>\u53EF\u7D22\u5F15\u7684\u5C5E\u6027\u5E94\u8BE5\u6309\u7167\u7D22\u5F15\u503C\u5927\u5C0F\u5347\u5E8F\u6392\u5217\uFF0C\u800C\u547D\u540D\u5C5E\u6027\u6839\u636E\u521B\u5EFA\u7684\u987A\u5E8F\u5347\u5E8F\u6392\u5217\u3002</li></ol><ul><li>\u5BF9\u4E8E\u7B2C\u4E00\u70B9\uFF1A\u5728 V8 \u5F15\u64CE\u5B9E\u73B0\u4E2D\uFF0C\u4F7F\u7528 \u9690\u85CF\u7C7B\uFF08Hidden Class\uFF09\u7ED3\u6784\u6765\u7BA1\u7406\u5206\u79BB\u51FA\u6765\u7684\u5C5E\u6027\u7279\u6027\u3002</li><li>\u5BF9\u4E8E\u7B2C\u4E8C\u70B9\uFF1A\u5728 V8 \u5F15\u64CE\u5B9E\u73B0\u4E2D\uFF0C\u5C06\u53EF\u7D22\u5F15\u5C5E\u6027\u4F1A\u88AB\u5B58\u50A8\u5230 Elements \u6307\u9488\u6307\u5411\u7684\u5185\u5B58\u533A\u57DF\uFF0C\u547D\u540D\u5C5E\u6027\u4F1A\u88AB\u5B58\u50A8\u5230 Properties \u6307\u9488\u6307\u5411\u7684\u5185\u5B58\u533A\u57DF\u3002</li></ul><blockquote><p>\u5B66\u672F\u8BBA\u6587\u79F0\u5B83\u4EEC\u4E3A Hidden Classes\uFF08\u5BB9\u6613\u4E0E JavaScript \u4E2D\u7684\u7C7B\u6982\u5FF5\u6DF7\u6DC6\uFF09<br> V8 \u5C06\u5B83\u4EEC\u79F0\u4E3A Maps\uFF08\u5BB9\u6613\u4E0E JavaScript \u4E2D\u7684 Map \u6982\u5FF5\u6DF7\u6DC6\uFF09<br> Chakra \u5C06\u5B83\u4EEC\u79F0\u4E3A Types\uFF08\u5BB9\u6613\u4E0E JavaScript \u4E2D\u7684\u52A8\u6001\u7C7B\u578B\u548C\u5173\u952E\u5B57 typeof \u6DF7\u6DC6\uFF09<br> JavaScriptCore \u79F0\u5B83\u4EEC\u4E3A Structures<br> SpiderMonkey \u79F0\u4ED6\u4EEC\u4E3A Shapes</p></blockquote><p>\u65E2\u7136\u5BF9\u8C61\u662F\u952E\u503Ck-v\u7ED3\u6784\uFF0C<strong>\u4E3A\u4EC0\u4E48\u4E0D\u76F4\u63A5\u7528\u5B57\u5178\u7ED3\u6784\u5B58\u50A8\uFF0C\u8FD8\u8981\u62C6\u6210\u5E8F\u5217\u5C5E\u6027\u548C\u547D\u540D\u5C5E\u6027\uFF0C\u53C8\u518D\u6B21\u5206\u6210\u4F7F\u7528\u6570\u7EC4\u7ED3\u6784\u7684\u5FEB\u5C5E\u6027\u548C\u54C8\u5E0C\u7ED3\u6784\u7684\u6162\u5C5E\u6027\uFF1F</strong></p><p>\u7B54\u6848\u90FD\u662F\u4E3A\u4E86\u52A0\u5FEB\u5BF9\u8C61\u5C5E\u6027\u8C03\u7528\u65F6\u7684\u67E5\u627E\u901F\u5EA6 \u548C \u8282\u7701\u5185\u5B58\u7A7A\u95F4\u3002</p><ul><li>\u5BF9\u5E8F\u5217\u5C5E\u6027\uFF08\u5BF9\u8C61\u7684\u952E\u662F\u6570\u503C\u6216\u6570\u503C\u578B\u5B57\u7B26\u4E32\uFF09\u5B58\u5728 elements \u7ED3\u6784\u4E2D <ul><li>\u5982\u679C\u5E8F\u5217\u5C5E\u6027\u662F\u8FDE\u7EED\u7684\u7D27\u5BC6\u6570\u7EC4\uFF0C\u5219 elements \u91C7\u7528\u6570\u7EC4 Array \u7ED3\u6784\u5B58\u50A8</li><li>\u5982\u679C\u5E8F\u5217\u5C5E\u6027\u662F\u542B\u6709\u7A7A\u6D1E hole \u7684\u7A00\u758F\u6570\u7EC4\uFF0C\u5219 elements \u91C7\u7528\u54C8\u5E0C\u7ED3\u6784 hashMap</li></ul></li><li>\u5BF9\u547D\u540D\u5C5E\u6027\uFF08\u4EE5\u5B57\u7B26\u4E32\u6216symbol\u4F5C\u4E3A\u952Ekey\u7684\u5C5E\u6027\uFF09\u5B58\u5728 properties <ul><li>\u5BF9\u6570\u91CF\u8F83\u5C0F\u7684\uFF08V8\u662F10\u4E2A\uFF08\u542B\uFF09\u4EE5\u5185\uFF09\u547D\u540D\u5C5E\u6027\u76F4\u63A5\u4FDD\u5B58\u5728\u5BF9\u8C61\u7ED3\u6784\u5185\uFF0C\u79F0\u5BF9\u8C61\u5185\u5C5E\u6027\uFF08in-object properties\uFF09</li><li>\u5982\u679C\u6570\u91CF\u4E2D\u7B49\uFF08\u5177\u4F53\u89C6\u5F15\u64CE\u5B9E\u73B0\uFF09\uFF0C\u5219\u8D85\u51FA\u7684\u5269\u4F59\u547D\u540D\u5C5E\u6027\u4FDD\u5B58\u5728 properties \u4E2D\uFF0C\u5E76\u4EE5 Array \u7ED3\u6784\u4FDD\u5B58\u5176\u503Cvalue\u5728 FixedArray \u4E2D\u5185\u5B58\u5730\u5740\uFF0C\u4F9D\u6B21\u5C5E\u6027\u521B\u5EFA\u65F6\u7684\u987A\u5E8F\uFF0C\u8BFB\u5C5E\u6027\u65F6\u503C\u7684\u504F\u79FB\u91CF\u4FDD\u5B58\u5728\u9690\u85CF\u7C7B\u4E2D\u3002\u79F0\u4E3A\u5FEB\u5C5E\u6027\uFF0C\u56E0\u4E3A\u662F\u901A\u8FC7 array \u7ED3\u6784\u4FDD\u5B58\uFF0C\u8BFB\u53D6\u901F\u5EA6\u8F83\u5FEB</li><li>\u5982\u679C\u6570\u91CF\u8F83\u5927\uFF0C\u5219\u5269\u4F59\u547D\u540D\u5C5E\u6027\u8FD8\u662F\u4FDD\u5B58\u5728 properties \u4E2D\uFF0C\u4F46\u7ED3\u6784\u91C7\u7528\u4E86 hashMap \u5B58\u50A8\uFF0C\u5E76\u4E14\u5176\u5C5E\u6027\u7684\u952E\u548C\u503C\u90FD\u88AB\u5B58\u50A8\u3002</li></ul></li></ul><p><strong>\u4E3A\u4EC0\u4E48\u8981\u4F7F\u7528\u6570\u7EC4\u7ED3\u6784\u7684\u5FEB\u5C5E\u6027\u548C\u54C8\u5E0C\u7ED3\u6784\u7684\u6162\u5C5E\u6027\uFF1F</strong></p><p>\u56E0\u4E3A\u5C11\u91CF\u6570\u636E\u65F6\u7EBF\u6027\u7684\u6570\u7EC4\u7ED3\u6784\u67E5\u627E\u66F4\u4F18\uFF0C\u800C\u5927\u91CF\u6570\u636E\u65F6\u975E\u7EBF\u6027\u7684\u54C8\u5E0C\u8868\u67E5\u627E\u66F4\u4F18\u3002\u53E6\u5916\u5BF9\u66F4\u591A\u7A7A\u6D1E\u7684\u7A00\u758F\u6570\u7EC4\u91C7\u7528\u54C8\u5E0C\u7ED3\u6784\u4E5F\u8282\u7701\u4E86\u5185\u5B58\u7A7A\u95F4\u3002</p><p><strong>\u4E3A\u4EC0\u4E48\u8981\u6DFB\u52A0\u9690\u85CF\u7C7B\u5462\uFF1F</strong></p><p>\u5728 ECMAScript \u4E2D\uFF0C\u5BF9\u8C61\u5C5E\u6027\u7684 Attribute \u88AB\u63CF\u8FF0\u4E3A\u4EE5\u4E0B\u7ED3\u6784\u3002</p><ul><li><code>[[Value]]</code>\uFF1A\u5C5E\u6027\u7684\u503C</li><li><code>[[Writable]]</code>\uFF1A\u5B9A\u4E49\u5C5E\u6027\u662F\u5426\u53EF\u5199\uFF08\u5373\u662F\u5426\u80FD\u88AB\u91CD\u65B0\u5206\u914D\uFF09</li><li><code>[[Enumerable]]</code>\uFF1A\u5B9A\u4E49\u5C5E\u6027\u662F\u5426\u53EF\u679A\u4E3E</li><li><code>[[Configurable]]</code>\uFF1A\u5B9A\u4E49\u5C5E\u6027\u662F\u5426\u53EF\u914D\u7F6E\uFF08\u5220\u9664\uFF09</li></ul><p>\u5927\u591A\u6570\u60C5\u51B5\u4E0B\uFF0C\u9664\u4E86\u5BF9\u8C61\u5C5E\u6027\u7684 <code>[[Value]]</code> \u7ECF\u5E38\u4F1A\u53D1\u751F\u53D8\u52A8\u7684\uFF0C\u800C \u5176\u5B83 Attribute \u662F\u51E0\u4E4E\u4E0D\u600E\u4E48\u4F1A\u53D8\u7684\u3002\u90A3\u5BF9\u540C\u4E00\u4E2A\u5BF9\u8C61\u7684\u591A\u4E2A\u5C5E\u6027\uFF0C\u751A\u81F3\u5BF9\u5177\u6709\u76F8\u540C\u5C5E\u6027\u7ED3\u6784\u7684\u4E0D\u540C\u5BF9\u8C61\uFF0C\u90FD\u8981\u5404\u81EA\u7EF4\u62A4\u4E00\u4EFD\u51E0\u4E4E\u4E0D\u4F1A\u6539\u53D8\u7684 <code>[[Writable]] / [[Enumerable]] / [[Configurable]]</code>\u5462\uFF1F\u663E\u7136\u8FD9\u662F\u4E00\u79CD\u5185\u5B58\u6D6A\u8D39\u3002</p><p>\u6240\u4EE5\u5927\u591A\u6570\u5F15\u64CE\u90FD\u5BF9\u6B64\u62BD\u8C61\u4E86 \u9690\u85CF\u7C7B\uFF08Hidden Class\uFF09\u6765\u63CF\u8FF0\u8FD9\u90E8\u5206\u7ED3\u6784\uFF0C\u5E76\u4E14\u4E5F\u4F5C\u4E86\u4F18\u5316\u5904\u7406\uFF0C\u4F7F\u7528 <a href="https://zhuanlan.zhihu.com/p/38202123" target="_blank" rel="noopener noreferrer">Transition \u94FE\u4E0E\u6811</a>\u6765\u63CF\u8FF0\u3002</p><p><strong>delete \u64CD\u4F5C\u5BF9\u8C61\u5C5E\u6027\u7684\u5F71\u54CD</strong></p><p>delete \u64CD\u4F5C\u53EF\u80FD\u4F1A\u6539\u53D8\u5BF9\u8C61\u7684\u7ED3\u6784\uFF0C\u5BFC\u81F4\u5F15\u64CE\u5C06\u5BF9\u8C61\u547D\u540D\u5C5E\u6027 properties \u7684\u5B58\u50A8\u65B9\u5F0F\u7531\u7EBF\u6027\u7684\u6570\u7EC4\u964D\u7EA7\u4E3A\u975E\u7EBF\u6027\u7684\u54C8\u5E0C\u8868\u5B58\u50A8\u7684\u65B9\u5F0F\uFF0C\u5373\u5C06\u5FEB\u5C5E\u6027\u964D\u4E3A\u6162\u5C5E\u6027\u5B58\u50A8\uFF0C\u5E76\u4E14\u4E5F\u4F1A\u5BFC\u81F4\u9690\u85CF\u7C7B\u4E0D\u540C\uFF0C\u4E0D\u80FD\u590D\u7528\u5176\u5B83\u540C\u7ED3\u6784\u5BF9\u8C61\u7684 shape \u5B9E\u4F8B\uFF0C\u4E0D\u5229\u4E8E V8 \u7684\u4F18\u5316\uFF0C\u5E94\u5C3D\u53EF\u80FD\u907F\u514D\u4F7F\u7528\uFF08\u5F53\u6CBF\u7740\u5C5E\u6027\u6DFB\u52A0\u7684\u53CD\u65B9\u5411\u5220\u9664\u5C5E\u6027\u65F6\uFF0C\u5BF9\u8C61\u4E0D\u4F1A\u9000\u5316\u4E3A\u54C8\u5E0C\u5B58\u50A8\uFF09\u3002</p><p>\u4E0A\u8FF0\u5185\u5BB9\u662F\u4E00\u4E2A\u81EA\u6211\u8BB0\u5FC6\u7684\u603B\u7ED3\uFF0C\u4E3B\u8981\u53C2\u8003\u4EE5\u4E0B\u4E24\u7BC7\u6587\u7AE0\uFF0C\u5E76\u4E14\u90FD\u6709\u66F4\u8BE6\u7EC6\u7684\u914D\u56FE</p><p><a href="https://www.cnblogs.com/chargeworld/p/12236848.html#top" target="_blank" rel="noopener noreferrer">V8 \u662F\u600E\u4E48\u8DD1\u8D77\u6765\u7684 \u2014\u2014 V8 \u4E2D\u7684\u5BF9\u8C61\u8868\u793A</a><br><a href="https://zhuanlan.zhihu.com/p/38202123" target="_blank" rel="noopener noreferrer">JavaScript \u5F15\u64CE\u57FA\u7840\uFF1AShapes \u548C Inline Caches</a><br><a href="https://time.geekbang.org/column/article/213250" target="_blank" rel="noopener noreferrer">\u5FEB\u5C5E\u6027\u548C\u6162\u5C5E\u6027\uFF1AV8\u91C7\u7528\u4E86\u54EA\u4E9B\u7B56\u7565\u63D0\u5347\u4E86\u5BF9\u8C61\u5C5E\u6027\u7684\u8BBF\u95EE\u901F\u5EA6\uFF1F</a></p><p>\u66F4\u591A\u53C2\u8003\u8D44\u6599\uFF1A</p><p>\u5173\u4E8E\u5BF9\u8C61\u7C7B\u578B\u7684\u503C\u5982\u4F55\u5728\u5185\u5B58\u4E2D\u5B58\u50A8\uFF0C\u6BD4\u8F83\u5E95\u5C42\uFF0C\u6D89\u53CA JS V8\u5F15\u64CE\u7684\u5B9E\u73B0\uFF0C\u53EF\u4EE5\u53C2\u8003\u4EE5\u4E0B\u6587\u7AE0\uFF1A</p><p><a href="https://zhuanlan.zhihu.com/p/26169639" target="_blank" rel="noopener noreferrer">\u4ECEChrome\u6E90\u7801\u770B\u7CFB\u5217</a><br><a href="https://zhuanlan.zhihu.com/p/24982678" target="_blank" rel="noopener noreferrer">V8 Object \u5185\u5B58\u7ED3\u6784\u4E0E\u5C5E\u6027\u8BBF\u95EE\u8BE6\u89E3</a><br><a href="https://www.anquanke.com/post/id/185339" target="_blank" rel="noopener noreferrer">JS \u7C7B\u578B\u5BF9\u8C61\u7684\u5185\u5B58\u5E03\u5C40\u603B\u7ED3</a><br><a href="https://www.cnblogs.com/zhoulujun/p/10881639.html" target="_blank" rel="noopener noreferrer">\u518D\u8C08js\u5BF9\u8C61\u6570\u636E\u7ED3\u6784\u5E95\u5C42\u5B9E\u73B0\u539F\u7406-object array map set</a><br><a href="https://mp.weixin.qq.com/s/np9Yoo02pEv9n_LCusZn3Q" target="_blank" rel="noopener noreferrer">\u63A2\u7A76JS V8\u5F15\u64CE\u4E0B\u7684\u201C\u6570\u7EC4\u201D\u5E95\u5C42\u5B9E\u73B0</a><br><a href="https://zhuanlan.zhihu.com/p/29638866" target="_blank" rel="noopener noreferrer">\u6570\u7EC4\u5728 V8 \u4E2D\u7684\u5143\u7D20\u79CD\u7C7B\u53CA\u6027\u80FD\u4F18\u5316</a>--\u907F\u514D\u7A7A\u6D1E\u6570\u7EC4\uFF08\u7A00\u758F\u6570\u7EC4\uFF09\u548C \u7C7B\u6570\u7EC4\u8F6C\u4E3A\u6570\u7EC4\u64CD\u4F5C\u66F4\u4F18</p>',27),p=[o];function i(n,s,c,h,u,b){return l(),r("div",null,p)}var m=e(a,[["render",i]]);export{_ as __pageData,m as default};
